import React, { Component } from 'react';
import CarTableRow from './CarTableRow';

export default class CarTable extends Component 
{
    constructor(props) 
    {
        super(props);
        this.state = {cars: this.props.cars};
        this.state = {redirectToSomePage: false}
    }


    render() 
    {
        return (


                <table>
                    {this.state.redirectToSomePage ? <Redirect to="/SomePage"/> : null}
                  <thead>
                    <tr>
                      <th>Model</th>
                      <th>Colour</th>
                      <th>Year</th>
                      <th>Price</th>                      
                    </tr>
                  </thead>

                  <tbody>
                    {this.props.cars.map((car) => <CarTableRow key={car._id} car={car}/>)}
                  </tbody>
                </table>      
               );
    }
}
